import React from 'react';
import { Link, Redirect } from 'react-router-dom';
import { Row, Col } from 'react-bootstrap';

const home = () => {

  return (
    <div>
      <Row>
        <div className="home-page">
          <Col className="home-col" xs={2}>1 of 3</Col>
          <Col className="home-col" xs={2}>2 of 3 (wider)</Col>
          <Col className="home-col" xs={2}>3 of 3</Col>
          <Col className="home-col" xs={2}>1 of 03</Col>
          <Col className="home-col" xs={2}>2 of 03</Col>
        </div>
      </Row>
    </div>
  )
}

export default home;
